text:
Le Président de la République, arrête:
Art. 1er —  Sont, à compter de la date de signature du présent arrêté, nommés chargés d'études à la division des enquêtes du corps spécialisé d'officiers de police judiciaire du Tribunal Criminel Spécial :
M. Olgane Aloys Emmanuel, (Mle: 570 422-B), Commissaire de Police Principal, poste créé;
M. Hamadou (Mle : 600 007-F), Commissaire de Police Principal, poste créé;
M. Ndinga Jean Claude (Mle: 565 854-N), Chef d'Escadron, poste créé ;
M. Nkwain Julius Mbom (Mle: 565 786-N), Chef d'Escadron, poste créé.
Art. 2 —  Les intéressés auront droit aux avantages de toute nature prévus par la réglementation en vigueur.
Art. 3 —  Le présent arrêté sera enregistré, publié suivant la procédure d'urgence, puis inséré au Journal officiel en français et en anglais.
